import "@/config/axiosConfig";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Provider } from "react-redux";
import { ThemeProvider } from "@mui/material/styles";
import store from "./store";
import themeConfig from "./config/themeConfig";

import SignUp from "./views/auth/SignUp";
import SignIn from "./views/auth/SignIn";

import Home from "./views/pages/Home";
import Services from "./views/pages/Services";
import Users from "./views/pages/Users";
import User from "./views/pages/Users/User";
import Artists from "./views/pages/Artists";
import Project from "./views/pages/Artists/Project";
import Portfolio from "./views/pages/Portfolio";
import ErrorBoundary from "./hoc/ErrorBoundary";

import Snackbar from "@/hoc/@app/Snackbar";

function App() {
  return (
    <div className="App">
      <Provider store={store}>
        <ThemeProvider theme={themeConfig}>
          <ErrorBoundary>
            <Snackbar />
            <BrowserRouter>
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="services" element={<Services />} />
                <Route path="portfolios" element={<Portfolio />} />
                <Route path="users" element={<Users />}>
                  <Route path=":userId" element={<User />} />
                </Route>
                <Route path="artists">
                  <Route index element={<Artists />} />
                  <Route path=":projectId" element={<Project />} />
                </Route>
                <Route path="auth">
                  <Route path="signup" element={<SignUp />} />
                  <Route path="signin" element={<SignIn />} />
                </Route>
              </Routes>
            </BrowserRouter>
          </ErrorBoundary>
        </ThemeProvider>
      </Provider>
    </div>
  );
}

export default App;
